import React from "react";
import { XCircle } from "react-feather";
import apa from "../../../images/logos/apa.png";

const ComparisonItem = ({
  setselected,
  item,
  items,
  removeFromComparisonList,
}) => {
  return (
    <>
      <div className="item">
        <div className="desc">
          <div className="logo">
            <img src={item.company} alt="" />
          </div>
          <div className="name">
            <span>{item.name}</span>
          </div>
          <div className="price">
            <span>KSH {item.price} /yr</span>
          </div>
        </div>
        <button
          onClick={() => {
            console.log(items);
            items < 2 && setselected("");
            removeFromComparisonList(item.code);
          }}
        >
          <XCircle size={15} />
        </button>
      </div>
    </>
  );
};

export default ComparisonItem;
